function Home() {
    const classes = useStyles()

    return (
        <div className={classes.root}>
            <div className={classes.roots2} >
                <Button variant="contained" color ="inherit" size="small" component={NavLink} to="/marketplace">
                 <strong>Buy & Sell at Aim√© Leon Dore</strong>
                </Button>
                </div>
        </div>
    )
}

export default Home;
